You can use this attribute as any other attribute is used, with #[is_tested], this attribute takes one argument, a string serving as path, this path is the path (from project's root) of the tests for that item. As an example: use is_tested::is_tested; #[is_tested("tests/my_func_tests.rs")]
fn my_func() { // [...]
} You can use the attribute in any testable item , like structs, functions, macros... Some items aren't included in the ecosystem because testing them isn't useful (like use statements). Now continue reading the main chapter, The Binary .

